import React, { useState, useEffect } from 'react';

const AnalyticsPage = () => {
  const [comunicados, setComunicados] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchAnalytics = async () => {
      try {
        const response = await fetch('http://localhost:3000/api/comunicados');
        if (!response.ok) {
          throw new Error('Erro ao carregar dados de análise.');
        }
        const data = await response.json();
        setComunicados(data);
      } catch (err) {
        setError(err.message);
      } finally {
        setIsLoading(false);
      }
    };

    fetchAnalytics();
  }, []);

  if (isLoading) {
    return <div className="text-center p-8 text-xl">Carregando análises...</div>;
  }

  if (error) {
    return <div className="text-center p-8 text-red-500 font-bold">Erro: {error}</div>;
  }

  return (
    <div className="container mx-auto p-4 max-w-5xl">
      <h1 className="text-3xl font-bold mb-6 text-center">Painel de Análise de Satisfação</h1>
      
      {comunicados.length === 0 ? (
        <p className="text-center text-gray-500">Nenhum comunicado encontrado. Crie um para começar a coletar feedback!</p>
      ) : (
        <div className="grid gap-6">
          {comunicados.map((comunicado) => (
            <div key={comunicado.id} className="bg-white p-6 rounded-lg shadow-md">
              <h2 className="text-2xl font-semibold text-gray-800 mb-1">{comunicado.titulo}</h2>
              <p className="text-sm text-gray-500 mb-4">Entregue em: {comunicado.data}</p>

              <div className="flex items-center space-x-4 mb-4">
                <p className="text-lg font-bold text-indigo-600">
                  Média de Satisfação: {comunicado.mediaSatisfacao}
                </p>
                <p className="text-sm text-gray-500">
                  (Baseado em {comunicado.numFeedbacks} avaliações)
                </p>
              </div>

              <div className="mb-4">
                <h3 className="font-bold text-gray-700 mb-2">Distribuição das Notas:</h3>
                <div className="space-y-1">
                  {[5, 4, 3, 2, 1].map((nota) => (
                    <div key={nota} className="flex items-center">
                      <span className="w-8 text-sm text-gray-600">{nota} ⭐</span>
                      <div className="w-full bg-gray-200 rounded-full h-2.5 ml-2">
                        <div
                          className="bg-blue-600 h-2.5 rounded-full"
                          style={{ width: `${(comunicado.distribuicao[nota] / (comunicado.numFeedbacks || 1)) * 100}%` }}
                        ></div>
                      </div>
                      <span className="text-sm text-gray-600 ml-2">{comunicado.distribuicao[nota]}</span>
                    </div>
                  ))}
                </div>
              </div>

              <div className="border-t pt-4">
                <h3 className="font-bold text-gray-700 mb-2">Comentários:</h3>
                {comunicado.feedbacks.filter(f => f.comentario).length > 0 ? (
                  <ul className="list-disc list-inside space-y-2 text-gray-600">
                    {comunicado.feedbacks.filter(f => f.comentario).map((f, index) => (
                      <li key={index} className="italic text-sm">"{f.comentario}"</li>
                    ))}
                  </ul>
                ) : (
                  <p className="italic text-gray-400 text-sm">Nenhum comentário para esta entrega.</p>
                )}
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default AnalyticsPage;
